import Preloader from '../../common/Preloader/Preloader';
import s from './UserProfile.module.css';


let UserProfile = (props) => {
    if (!props.profile) {
        return <Preloader />
    }
    return (
        <div>
            <img src={props.profile.photos.large} alt=''/>
        </div>

    );
}


export default UserProfile
